import './App.css';
import Dashboard from './Page/Dashboard';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Login from './Page/Dashboard/login.js';
import { contactSlice } from '../features/ContactUser/contactSlice';

function App() {
  return (
    <div>
      <Dashboard />
      <Router>
        <Switch>
          {/* other routes */}
          <Route exact path="/login" component={Login} />
          {/* other routes */}
        </Switch>
      </Router>
    </div>
  );
}

export default App;
